def get_delta(matrix, group_option):
    n = matrix.shape[0]
    in_group = []
    out_group = []
    for i in range(n):
        for j in range(n):
            if np.isnan(matrix[i, j]):
                continue
            if check_in_group(group_option, i, j):
                in_group.append(matrix[i, j])
            else:
                out_group.append(matrix[i, j])
    if in_group and out_group:
        delta = np.mean(in_group) - np.mean(out_group)
    else:
        delta = np.nan
    return delta
